INSERT INTO `question_management_question` VALUES (1,'章节2难度10选择题to_xant1','中文答案1',10,'SZ','2'),(2,'章节1难度60选择题to_xant1','答案2',60,'SZ','1'),(3,'章节1难度55填空题to_xant1','答案3',55,'TK','1'),(4,'章节2难度77填空题to_xant1','答案',77,'TK','2'),(5,'章节1难度40判断题to_xant1','答案',40,'PD','1'),(6,'章节2难度88判断题to_xant1','答案',88,'PD','2'),(7,'章节1难度33简答题to_xant1','答案',33,'SF','1'),(8,'章节2难度54简答题to_xant1','答案',54,'SF','2'),(9,'（  ）是构成C语言程序的基本单位。\r\n\r\nA、函数 B、过程 C、子程序 D、子例程','A',30,'SZ','1'),(10,'C语言程序从（）开始执行。\r\n\r\n(A) 程序中第一条可执行语句 (B) 程序中第一个函数\r\n\r\n(C) 程序中的main函数（D) 包含文件中的第一个函数','C',20,'SZ','1'),(11,'以下说法中正确的是（ ）。\r\n\r\nA、C语言程序总是从第一个定义的函数开始执行\r\n\r\nB、在C语言程序中，要调用的函数必须在main( )函数中定义\r\n\r\nC、C语言程序总是从main( )函数开始执行\r\n\r\nD、C语言程序中的main( )函数必须放在程序的开始部分','C',25,'SZ','1'),(12,'下列关于C语言的说法错误的是（ ） 。\r\n\r\nA) C程序的工作过程是编辑、编译、连接、运行\r\n\r\nB) C语言不区分大小写\r\n\r\nC) C程序的三种基本结构是顺序、选择、循环\r\n\r\nD) C程序从main函数开始执行','B',27,'SZ','1'),(13,'下列正确的标识符是（　）。\r\n\r\nA.-a1 B.a[i] C.a2_i D.int t','C',30,'SZ','1'),(14,'下列C语言用户标识符中合法的是（  ）。\r\n\r\nA)3ax B)x C)case D)-e2 E)union','B',33,'SZ','1'),(15,'下列四组选项中，正确的C语言标识符是（  ）。\r\n\r\nA） %x B） a+b C） a123 D） 123','C',35,'SZ','1'),(16,'下列四组字符串中都可以用作C语言程序中的标识符的是（  ）。\r\n\r\nA、print _3d db8 aBc B、I\\am one_half start$it 3pai\r\n\r\nC、str_1 Cpp pow while D、Pxq My->book line# His.age','A',44,'SZ','2'),(17,'C语言中的简单数据类型包括（ ）。\r\n\r\nA、整型、实型、逻辑型 B、整型、实型、逻辑型、字符型\r\n\r\nC、整型、字符型、逻辑型 D、整型、实型、字符型','D',33,'SZ','2'),(18,'在C语言程序中，表达式5%2的结果是（）。\r\n\r\nA)2.5 B)2 C)1 D)3','C',22,'SZ','2'),(19,'如果int a=3,b=4；则条件表达式\"a<b? a:b\"的值是（）。\r\n\r\nA) 3 B) 4 C) 0 D) 1','A',55,'SZ','2'),(20,'若int x=2,y=3,z=4 则表达式x<z?y:z的结果是(  ).\r\n\r\nA)4 B)3 C)2 D)0 E)1','B',58,'SZ','2'),(21,'C语言中，关系表达式和逻辑表达式的值是（  ） 。\r\n\r\nA) 0 B) 0或1 C) 1 D) ‘T’或’F’','B',55,'SZ','2'),(22,'下面(  )表达式的值为4。\r\n\r\nA) 11/3 B) 11.0/3\r\n\r\nC) (float)11/3 D) (int)(11.0/3+0.5)','D',55,'SZ','2'),(23,'设整型变量 a=2，则执行下列语句后，浮点型变量b的值不为0.5的是（ 　）\r\n\r\nA.b=1.0/a B.b=(float)(1/a)\r\n\r\nC.b=1/(float)a D.b=1/(a*1.0)','B',60,'SZ','3'),(24,'若“int n; float f=1