r\n\r\ni=1;a=0;s=1;\r\ndo{a=a+s*i;s=-s;i++;}while<i<=10>;\r\nprintf<\"a=%d\",a>;','a=-5',77,'TK','2'),(45,'下面程序段的运行结果是______.\r\ni=1;s=3;\r\ndo{s+=i++;\r\nif<s%7==0>continue;\r\nelse ++i;\r\n}while<s<15>;\r\nprintf<\"%d\",i>;','8',80,'TK','2'),(46,'当从键盘输入18并回车后,下面程序的运行结果是_______.\r\n\r\nmain<>\r\n{int x,y,i,a[8],j,u,v;\r\nscanf<\"%d\",&x>;\r\ny=x;i=0;\r\ndo\r\n{u=y/2;\r\na[i]=y%2;\r\ni++;y=u;\r\n}while<y>=1>;\r\nfor<j=i-1;j>=0;j-->\r\nprintf<\"%d\",a[j]>;\r\n}','10010',67,'TK','2'),(47,'下面程序的运行结果是_________.\r\n#include<stdio.h>\r\nmain<>\r\n{char s[]=\"ABCCDA\";\r\nint k;\r\nchar c;\r\nfor<k=1;<c=s[k]>!=\'\\0\';k++>\r\n{switch<c>\r\n{case \'A\':putchar<\'%\'>;continue;\r\ncase \'B\':++k;break;\r\ndefault:putchar<\'*\'>;\r\ncase \'C\':putchar<\'&\'>;continue;\r\n}\r\nputchar<\'#\'>;\r\n}\r\n}','#&*&%',88,'TK','2'),(48,'以下程序的运行结果是:_____\r\n#include<stdio.h>\r\nint max<int,int>;\r\nmain<>\r\n{int a=1,b=2,c;\r\nc=max<a,b>;\r\nprintf<\"max is %d\\n\",c>;\r\n}\r\nint max<int x,int y>\r\n{int z;\r\nz=<x>y>?x:y;\r\nreturn<z>;\r\n}','max is 2',54,'TK','1'),(49,'以下程序的运行结果是：_____.\r\n\r\n#include <stdio.h>\r\nint a=5;int b=7;\r\nint plus<int ,int >;\r\nvoid main<>\r\n{ int a=4,b=5,c;\r\nc=plus<a,b>;\r\nprintf<\"A+B=%d\\n\",c>;\r\n}\r\nint plus<int x,int y>\r\n{int z;\r\nz=x+y;\r\nreturn<z>;\r\n}','A+B=9',76,'TK','1'),(50,'下面程序段的运行结果是_____.\r\n\r\nchar str[]=\"abc\\0def\\0ghi\",*p=str;\r\nprintf<\"%s\",p+5>;','ef',93,'TK','3'),(51,'若有 int x＝7, 则表达式 x+＝x－＝x+x; 执行后， x 的值为____.','1',16,'TK','3'),(52,'当运行以下程序时，从键盘键入right?(代表回车)，则下面程序的运行结果是。\r\n\r\n#include\r\n\r\nmain( )\r\n\r\n{  char c;\r\n\r\nwhile((c=getchar())!=\'?\')  putchar(++c)\r\n\r\n}','sjhiu?',88,'TK','3'),(53,'下面程序的运行结果是 。【】\r\n\r\n #include\r\n\r\n main()\r\n\r\n{ int i,x,y;\r\n\r\n   i=x=y=0;\r\n\r\n   do {++i;\r\n\r\n      if(i%2!=0)   {x=x+i;i++;}\r\n\r\n      y=y+i++;\r\n\r\n      } while (i<=7);\r\n\r\n      printf(\"x=%d,y=%d\\n\",x,y);\r\n\r\n}','x=1,y=20',87,'TK','3'),(54,'以下语句char str[10]={\"China\"}; printf(\"%d\",strlen(str))的输出结果是 （）。','5',34,'TK','1'),(55,'程序main()\r\n\r\n    {  int a[2][3]={{1,2,3},{4,5,6}};\r\n\r\n        int m,*ptr;\r\n\r\n        ptr=&a[0][0];\r\n\r\n        m=(*ptr)*(*(ptr+2))*(*(ptr+4));\r\n\r\n        printf(\"%d\\n\",m);\r\n\r\n}\r\n\r\n的运行结果是 。','15',88,'TK','1'),(56,'在C语言程序中，用关键字 【】定义单精度实型变量。','float',6,'TK','2'),(57,'int a=24; printf(\"%x \", a );输出结果是 。[]','18',34,'TK','3'),(58,'程序的输出值是 。 []\r\n\r\nvoid f(int  *p)\r\n{  \r\n*p=10;\r\n}\r\n int  *p;\r\nvoid  main( )\r\n{   \r\nf(p);\r\nprintf(\"%d\",(*p)++);\r\n}','10',44,'TK','3'),(59,'在if语句的三种形式中，如果要想在满足条件时执行一组(多个)语句，则必须把这一组语句用{}括起来组成一个复合语句。','T',22,'PD','1'),(60,'任何表达式语句都是表达式加分号组成的。','T',33,'PD','1'),(61,'do-while循环的while后的分号可以省略。','F',34,'PD','1'),(62,'case语句后如没有break，顺序向下执行。','T',54,'PD','1'),(63,'增1减1运算符的前缀运算和后缀运算的表达式值是相同的。','F',56,'PD','1'),(64,'函数的实参可以是常量，变量或表达式。','T',45,'PD','1'),(65,'如果函数定义出现在函数调用之前，可以不必加函数原型声明。','T',66,'PD','1'),(66,'C 语言程序中可以有多个函数 , 但只能有一个主函数。','T',76,'PD','1'),(67,'函数返回值的类型是由在定义函数时所指定的函数类型。','T',56,'PD','2'),(68,'局部变量如果没有指定初值，则其初值不确定。','T',87,'PD','2'),(69,'若有定义int a[]={2,4,6,8,10},p=a;a的值是数组首地址，则*(p+1)的值是4。','T',87,'PD','2'),(70,'指针数组的每个元素都是一个指针变量。','T',67,'PD','2'),(71,'关于C语言指针的运算：指针只有加减操作，没有乘除操作。指针可以加常数、减常数；相同类型的指针可以相加、相减。','F',67,'PD','2'),(72,'假设有定义如下： int array[10]; 则该语句定义了一个数组array。其中array的类型是整型指针（即： int *）。','F',55,'PD','2'),(73,'C 语言的标识符是区分大小写的。','T',67,'PD','2'),(74,'在编译 C 源程序时，计算机根本不会去识别各个变量名的具体含义，因此命名 规范对编写 C 程序而言不是必要的，而且有可能会降低编写 C 源程序的效率。','F',62,'PD','2'),(75,'C 语言中，注释不可以出现在程序中任意的地方。','F',5,'PD','3'),(76,'C 语言程序中的变量必须先声明后使用。','T',13,'PD','3'),(77,'在 C 语言中，\'B\'和\"B\"在内存中的表示没有区别。','F',12,'PD','3'),(78,'一个复合语句是作为一个语句处理的且在逻辑上相互关联的一组语句。','T',10,'PD','3'),(79,'C 语言程序的三种基本结构是顺序结构、分支（选择）结构和循环结构。','T',12,'PD','3'),(80,'C 语言的 double 类型数据可以精确表示任何实数。','F',18,'PD','3'),(81,'在 C 语言中，将语句“if(x==5) y++;”误写作“if(x=5) y++;”，将导致编译错误。','F',34,'PD','3'),(82,'在 switch 语句中，表达式和常量表达式的值只能是整型、字符型或枚举型。','T',11,'PD','3'),(83,'C 语言中，sizeof 运算符可以用于计算数组的长度。','F',43,'PD','1'),(84,'合并两个有序数组\r\n\r\n给你两个按 非递减顺序 排列的整数数组 nums1 和 nums2，另有两个整数 m 和 n ，分别表示 nums1 和 nums2 中的元素数目。\r\n请你 合并 nums2 到 nums1 中，使合并后的数组同样按 非递减顺序 排列。\r\n注意：最终，合并后数组不应由函数返回，而是存储在数组 nums1 中。为了应对这种情况，nums1 的初始长度为 m + n，其中前 m 个元素表示应合并的元素，后 n 个元素为 0 ，应忽略。nums2 的长度为 n 。\r\n\r\n示例 1：\r\n输入：nums1 = [1,2,3,0,0,0], m = 3, nums2 = [2,5,6], n = 3\r\n输出：[1,2,2,3,5,6]\r\n解释：需要合并 [1,2,3] 和 [2,5,6] 。\r\n合并结果是 [1,2,2,3,5,6] ，其中斜体加粗标注的为 nums1 中的元素。\r\n示例 2：\r\n输入：nums1 = [1], m = 1, nums2 = [], n = 0\r\n输出：[1]\r\n解释：需要合并 [1] 和 [] 。\r\n合并结果是 [1] 。\r\n示例 3：\r\n输入：nums1 = [0], m = 0, nums2 = [1], n = 1\r\n输出：[1]\r\n解释：需要合并的数组是 [] 和 [1] 。\r\n合并结果是 [1] 。\r\n注意，因为 m = 0 ，所以 nums1 中没有元素。nums1 中仅存的 0 仅仅是为了确保合并结果可以顺利存放到 nums1 中。\r\n\r\n提示：\r\nnums1.length == m + n\r\nnums2.length == n\r\n0 <= m, n <= 200\r\n1 <= m + n <= 200\r\n-109 <= nums1[i], nums2[j] <= 109','int cmp(int* a, int* b) {\r\n    return *a - *b;\r\n}\r\n\r\nvoid merge(int* nums1, int nums1Size, int m, int* nums2, int nums2Size, int n) {\r\n    for (int i = 0; i != n; ++i) {\r\n        nums1[m + i] = nums2[i];\r\n    }\r\n    qsort(nums1, nums1Size, sizeof(int), cmp);\r\n}',78,'SF','1'),(85,'移除元素\r\n\r\n给你一个数组 nums 和一个值 val，你需要 原地 移除所有数值等于 val 的元素，并返回移除后数组的新长度。\r\n不要使用额外的数组空间，你必须仅使用 O(1) 额外空间并 原地 修改输入数组。\r\n元素的顺序可以改变。你不需要考虑数组中超出新长度后面的元素。\r\n\r\n说明:\r\n为什么返回数值是整数，但输出的答案是数组呢?\r\n请注意，输入数组是以「引用」方式传递的，这意味着在函数里修改输入数组对于调用者是可见的。\r\n你可以想象内部操作如下:\r\n\r\n// nums 是以“引用”方式传递的。也就是说，不对实参作任何拷贝\r\nint len = removeElement(nums, val);\r\n\r\n// 在函数里修改输入数组对于调用者是可见的。\r\n// 根据你的函数返回的长度, 它会打印出数组中 该长度范围内 的所有元素。\r\nfor (int i = 0; i < len; i++) {\r\n    print(nums[i]);\r\n}\r\n \r\n示例 1：\r\n输入：nums = [3,2,2,3], val = 3\r\n输出：2, nums = [2,2]\r\n解释：函数应该返回新的长度 2, 并且 nums 中的前两个元素均为 2。你不需要考虑数组中超出新长度后面的元素。例如，函数返回的新长度为 2 ，而 nums = [2,2,3,3] 或 nums = [2,2,0,0]，也会被视作正确答案。\r\n示例 2：\r\n输入：nums = [0,1,2,2,3,0,4,2], val = 2\r\n输出：5, nums = [0,1,3,0,4]\r\n解释：函数应该返回新的长度 5, 并且 nums 中的前五个元素为 0, 1, 3, 0, 4。注意这五个元素可为任意顺序。你不需要考虑数组中超出新长度后面的元素。\r\n\r\n提示：\r\n0 <= nums.length <= 100\r\n0 <= nums[i] <= 50\r\n0 <= val <= 100','int removeElement(int* nums, int numsSize, int val) {\r\n    int left = 0;\r\n    for (int right = 0; right < numsSize; right++) {\r\n        if (nums[right] != val) {\r\n            nums[left] = nums[right];\r\n            left++;\r\n        }\r\n    }\r\n    return left;\r\n}',67,'SF','1'),(86,'删除有序数组中的重复项\r\n\r\n给你一个 非严格递增排列 的数组 nums ，请你 原地 删除重复出现的元素，使每个元素 只出现一次 ，返回删除后数组的新长度。元素的 相对顺序 应该保持 一致 。然后返回 nums 中唯一元素的个数。\r\n考虑 nums 的唯一元素的数量为 k ，你需要做以下事情确保你的题解可以被通过：\r\n更改数组 nums ，使 nums 的前 k 个元素包含唯一元素，并按照它们最初在 nums 中出现的顺序排列。nums 的其余元素与 nums 的大小不重要。\r\n返回 k 。\r\n判题标准:\r\n系统会用下面的代码来测试你的题解:\r\nint[] nums = [...]; // 输入数组\r\nint[] expectedNums = [...]; // 长度正确的期望答案\r\nint k = removeDuplicates(nums); // 调用\r\nassert k == expectedNums.length;\r\nfor (int i = 0; i < k; i++) {\r\n    assert nums[i] == expectedNums[i];\r\n}\r\n如果所有断言都通过，那么您的题解将被 通过。\r\n\r\n示例 1：\r\n输入：nums = [1,1,2]\r\n输出：2, nums = [1,2,_]\r\n解释：函数应该返回新的长度 2 ，并且原数组 nums 的前两个元素被修改为 1, 2 。不需要考虑数组中超出新长度后面的元素。\r\n示例 2：\r\n输入：nums = [0,0,1,1,1,2,2,3,3,4]\r\n输出：5, nums = [0,1,2,3,4]\r\n解释：函数应该返回新的长度 5 ， 并且原数组 nums 的前五个元素被修改为 0, 1, 2, 3, 4 。不需要考虑数组中超出新长度后面的元素。\r\n \r\n提示：\r\n1 <= nums.length <= 3 * 104\r\n-104 <= nums[i] <= 104\r\nnums 已按 非严格递增 排列','int removeDuplicates(int* nums, int numsSize) {\r\n    if (numsSize == 0) {\r\n        return 0;\r\n    }\r\n    int fast = 1, slow = 1;\r\n    while (fast < numsSize) {\r\n        if (nums[fast] != nums[fast - 1]) {\r\n            nums[slow] = nums[fast];\r\n            ++slow;\r\n        }\r\n        ++fast;\r\n    }\r\n    return slow;\r\n}',89,'SF','1'),(87,'多数元素\r\n\r\n给定一个大小为 n 的数组 nums ，返回其中的多数元素。多数元素是指在数组中出现次数 大于 ⌊ n/2 ⌋ 的元素。\r\n你可以假设数组是非空的，并且给定的数组总是存在多数元素。\r\n\r\n示例 1：\r\n输入：nums = [3,2,3]\r\n输出：3\r\n示例 2：\r\n输入：nums = [2,2,1,1,1,2,2]\r\n输出：2\r\n \r\n提示：\r\nn == nums.length\r\n1 <= n <= 5 * 104\r\n-109 <= nums[i] <= 109','class Solution {\r\npublic:\r\n    int majorityElement(vector<int>& nums) {\r\n        unordered_map<int, int> counts;\r\n        int majority = 0, cnt = 0;\r\n        for (int num: nums) {\r\n            ++counts[num];\r\n            if (counts[num] > cnt) {\r\n                majority = num;\r\n                cnt = counts[num];\r\n            }\r\n        }\r\n        return majority;\r\n    }\r\n};',78,'SF','1'),(88,'买卖股票的最佳时机\r\n\r\n给定一个数组 prices ，它的第 i 个元素 prices[i] 表示一支给定股票第 i 天的价格。\r\n你只能选择 某一天 买入这只股票，并选择在 未来的某一个不同的日子 卖出该股票。设计一个算法来计算你所能获取的最大利润。\r\n返回你可以从这笔交易中获取的最大利润。如果你不能获取任何利润，返回 0 。\r\n\r\n示例 1：\r\n输入：[7,1,5,3,6,4]\r\n输出：5\r\n解释：在第 2 天（股票价格 = 1）的时候买入，在第 5 天（股票价格 = 6）的时候卖出，最大利润 = 6-1 = 5 。\r\n     注意利润不能是 7-1 = 6, 因为卖出价格需要大于买入价格；同时，你不能在买入前卖出股票。\r\n示例 2：\r\n输入：prices = [7,6,4,3,1]\r\n输出：0\r\n解释：在这种情况下, 没有交易完成, 所以最大利润为 0。\r\n\r\n提示：\r\n1 <= prices.length <= 105\r\n0 <= prices[i] <= 104','class Solution {\r\npublic:\r\n    int maxProfit(vector<int>& prices) {\r\n        int inf = 1e9;\r\n        int minprice = inf, maxprofit = 0;\r\n        for (int price: prices) {\r\n            maxprofit = max(maxprofit, price - minprice);\r\n            minprice = min(price, minprice);\r\n        }\r\n        return maxprofit;\r\n    }\r\n};',89,'SF','1'),(89,'罗马数字转整数\r\n\r\n罗马数字包含以下七种字符: I， V， X， L，C，D 和 M。\r\n字符          数值\r\nI             1\r\nV             5\r\nX             10\r\nL             50\r\nC             100\r\nD             500\r\nM             1000\r\n例如， 罗马数字 2 写做 II ，即为两个并列的 1 。12 写做 XII ，即为 X + II 。 27 写做  XXVII, 即为 XX + V + II 。\r\n通常情况下，罗马数字中小的数字在大的数字的右边。但也存在特例，例如 4 不写做 IIII，而是 IV。数字 1 在数字 5 的左边，所表示的数等于大数 5 减小数 1 得到的数值 4 。同样地，数字 9 表示为 IX。这个特殊的规则只适用于以下六种情况：\r\nI 可以放在 V (5) 和 X (10) 的左边，来表示 4 和 9。\r\nX 可以放在 L (50) 和 C (100) 的左边，来表示 40 和 90。 \r\nC 可以放在 D (500) 和 M (1000) 的左边，来表示 400 和 900。\r\n给定一个罗马数字，将其转换成整数。\r\n\r\n示例 1:\r\n输入: s = \"III\"\r\n输出: 3\r\n示例 2:\r\n输入: s = \"IV\"\r\n输出: 4\r\n示例 3:\r\n输入: s = \"IX\"\r\n输出: 9\r\n示例 4:\r\n输入: s = \"LVIII\"\r\n输出: 58\r\n解释: L = 50, V= 5, III = 3.\r\n示例 5:\r\n输入: s = \"MCMXCIV\"\r\n输出: 1994\r\n解释: M = 1000, CM = 900, XC = 90, IV = 4.\r\n \r\n提示：\r\n1 <= s.length <= 15\r\ns 仅含字符 (\'I\', \'V\', \'X\', \'L\', \'C\', \'D\', \'M\')\r\n题目数据保证 s 是一个有效的罗马数字，且表示整数在范围 [1, 3999] 内\r\n题目所给测试用例皆符合罗马数字书写规则，不会出现跨位等情况。\r\nIL 和 IM 这样的例子并不符合题目要求，49 应该写作 XLIX，999 应该写作 CMXCIX 。','int romanToInt(char* s) {\r\n    int symbolValues[26];\r\n    symbolValues[\'I\' - \'A\'] = 1;\r\n    symbolValues[\'V\' - \'A\'] = 5;\r\n    symbolValues[\'X\' - \'A\'] = 10;\r\n    symbolValues[\'L\' - \'A\'] = 50;\r\n    symbolValues[\'C\' - \'A\'] = 100;\r\n    symbolValues[\'D\' - \'A\'] = 500;\r\n    symbolValues[\'M\' - \'A\'] = 1000;\r\n    int ans = 0;\r\n    int n = strlen(s);\r\n    for (int i = 0; i < n; ++i) {\r\n        int value = symbolValues[s[i] - \'A\'];\r\n        if (i < n - 1 && value < symbolValues[s[i + 1] - \'A\']) {\r\n            ans -= value;\r\n        } else {\r\n            ans += value;\r\n        }\r\n    }\r\n    return ans;\r\n}',95,'SF','1'),(90,'最后一个单词的长度\r\n\r\n给你一个字符串 s，由若干单词组成，单词前后用一些空格字符隔开。返回字符串中 最后一个 单词的长度。\r\n单词 是指仅由字母组成、不包含任何空格字符的最大子字符串。\r\n\r\n示例 1：\r\n输入：s = \"Hello World\"\r\n输出：5\r\n解释：最后一个单词是“World”，长度为5。\r\n示例 2：\r\n输入：s = \"   fly me   to   the moon  \"\r\n输出：4\r\n解释：最后一个单词是“moon”，长度为4。\r\n示例 3：\r\n输入：s = \"luffy is still joyboy\"\r\n输出：6\r\n解释：最后一个单词是长度为6的“joyboy”。\r\n \r\n提示：\r\n1 <= s.length <= 104\r\ns 仅有英文字母和空格 \' \' 组成\r\ns 中至少存在一个单词','class Solution {\r\npublic:\r\n    int lengthOfLastWord(string s) {\r\n        int index = s.size() - 1;\r\n\r\n        while (s[index] == \' \') {\r\n            index--;\r\n        }\r\n        int wordLength = 0;\r\n        while (index >= 0 && s[index] != \' \') {\r\n            wordLength++;\r\n            index--;\r\n        }\r\n\r\n        return wordLength;\r\n    }\r\n};',88,'SF','1'),(91,'找出字符串中第一个匹配项的下标\r\n\r\n给你两个字符串 haystack 和 needle ，请你在 haystack 字符串中找出 needle 字符串的第一个匹配项的下标（下标从 0 开始）。如果 needle 不是 haystack 的一部分，则返回  -1 。\r\n\r\n示例 1：\r\n输入：haystack = \"sadbutsad\", needle = \"sad\"\r\n输出：0\r\n解释：\"sad\" 在下标 0 和 6 处匹配。\r\n第一个匹配项的下标是 0 ，所以返回 0 。\r\n示例 2：\r\n输入：haystack = \"leetcode\", needle = \"leeto\"\r\n输出：-1\r\n解释：\"leeto\" 没有在 \"leetcode\" 中出现，所以返回 -1 。\r\n \r\n提示：\r\n1 <= haystack.length, needle.length <= 104\r\nhaystack 和 needle 仅由小写英文字符组成','int strStr(char* haystack, char* needle) {\r\n    int n = strlen(haystack), m = strlen(needle);\r\n    for (int i = 0; i + m <= n; i++) {\r\n        bool flag = true;\r\n        for (int j = 0; j < m; j++) {\r\n            if (haystack[i + j] != needle[j]) {\r\n                flag = false;\r\n                break;\r\n            }\r\n        }\r\n        if (flag) {\r\n            return i;\r\n        }\r\n    }\r\n    return -1;\r\n}',82,'SF','1'),(92,'验证回文串\r\n\r\n如果在将所有大写字符转换为小写字符、并移除所有非字母数字字符之后，短语正着读和反着读都一样。则可以认为该短语是一个 回文串 。\r\n字母和数字都属于字母数字字符。\r\n给你一个字符串 s，如果它是 回文串 ，返回 true ；否则，返回 false 。\r\n\r\n示例 1：\r\n输入: s = \"A man, a plan, a canal: Panama\"\r\n输出：true\r\n解释：\"amanaplanacanalpanama\" 是回文串。\r\n示例 2：\r\n输入：s = \"race a car\"\r\n输出：false\r\n解释：\"raceacar\" 不是回文串。\r\n示例 3：\r\n输入：s = \" \"\r\n输出：true\r\n解释：在移除非字母数字字符之后，s 是一个空字符串 \"\" 。\r\n由于空字符串正着反着读都一样，所以是回文串。\r\n \r\n提示：\r\n1 <= s.length <= 2 * 105\r\ns 仅由可打印的 ASCII 字符组成','class Solution {\r\npublic:\r\n    bool isPalindrome(string s) {\r\n        string sgood;\r\n        for (char ch: s) {\r\n            if (isalnum(ch)) {\r\n                sgood += tolower(ch);\r\n            }\r\n        }\r\n        string sgood_rev(sgood.rbegin(), sgood.rend());\r\n        return sgood == sgood_rev;\r\n    }\r\n};',88,'SF','2'),(93,'判断子序列\r\n\r\n给定字符串 s 和 t ，判断 s 是否为 t 的子序列。\r\n字符串的一个子序列是原始字符串删除一些（也可以不删除）字符而不改变剩余字符相对位置形成的新字符串。（例如，\"ace\"是\"abcde\"的一个子序列，而\"aec\"不是）。\r\n进阶：\r\n如果有大量输入的 S，称作 S1, S2, ... , Sk 其中 k >= 10亿，你需要依次检查它们是否为 T 的子序列。在这种情况下，你会怎样改变代码？\r\n\r\n示例 1：\r\n输入：s = \"abc\", t = \"ahbgdc\"\r\n输出：true\r\n示例 2：\r\n输入：s = \"axc\", t = \"ahbgdc\"\r\n输出：false\r\n \r\n提示：\r\n0 <= s.length <= 100\r\n0 <= t.length <= 10^4\r\n两个字符串都只由小写字符组成。','bool isSubsequence(char* s, char* t) {\r\n    int n = strlen(s), m = strlen(t);\r\n    int i = 0, j = 0;\r\n    while (i < n && j < m) {\r\n        if (s[i] == t[j]) {\r\n            i++;\r\n        }\r\n        j++;\r\n    }\r\n    return i == n;\r\n}',91,'SF','2'),(94,'同构字符串\r\n\r\n给定两个字符串 s 和 t ，判断它们是否是同构的。\r\n如果 s 中的字符可以按某种映射关系替换得到 t ，那么这两个字符串是同构的。\r\n每个出现的字符都应当映射到另一个字符，同时不改变字符的顺序。不同字符不能映射到同一个字符上，相同字符只能映射到同一个字符上，字符可以映射到自己本身。\r\n\r\n示例 1:\r\n输入：s = \"egg\", t = \"add\"\r\n输出：true\r\n示例 2：\r\n输入：s = \"foo\", t = \"bar\"\r\n输出：false\r\n示例 3：\r\n输入：s = \"paper\", t = \"title\"\r\n输出：true\r\n \r\n提示：\r\n1 <= s.length <= 5 * 104\r\nt.length == s.length\r\ns 和 t 由任意有效的 ASCII 字符组成','struct HashTable {\r\n    char key;\r\n    char val;\r\n    UT_hash_handle hh;\r\n};\r\n\r\nbool isIsomorphic(char* s, char* t) {\r\n    struct HashTable* s2t = NULL;\r\n    struct HashTable* t2s = NULL;\r\n    int len = strlen(s);\r\n    for (int i = 0; i < len; ++i) {\r\n        char x = s[i], y = t[i];\r\n        struct HashTable *tmp1, *tmp2;\r\n        HASH_FIND(hh, s2t, &x, sizeof(char), tmp1);\r\n        HASH_FIND(hh, t2s, &y, sizeof(char), tmp2);\r\n        if (tmp1 != NULL) {\r\n            if (tmp1->val != y) {\r\n                return false;\r\n            }\r\n        } else {\r\n            tmp1 = malloc(sizeof(struct HashTable));\r\n            tmp1->key = x;\r\n            tmp1->val = y;\r\n            HASH_ADD(hh, s2t, key, sizeof(char), tmp1);\r\n        }\r\n        if (tmp2 != NULL) {\r\n            if (tmp2->val != x) {\r\n                return false;\r\n            }\r\n        } else {\r\n            tmp2 = malloc(sizeof(struct HashTable));\r\n            tmp2->key = y;\r\n            tmp2->val = x;\r\n            HASH_ADD(hh, t2s, key, sizeof(char), tmp2);\r\n        }\r\n    }\r\n    return true;\r\n}',88,'SF','2'),(95,'单词规律\r\n\r\n给定一种规律 pattern 和一个字符串 s ，判断 s 是否遵循相同的规律。\r\n这里的 遵循 指完全匹配，例如， pattern 里的每个字母和字符串 s 中的每个非空单词之间存在着双向连接的对应规律。\r\n\r\n示例1:\r\n输入: pattern = \"abba\", s = \"dog cat cat dog\"\r\n输出: true\r\n示例 2:\r\n输入:pattern = \"abba\", s = \"dog cat cat fish\"\r\n输出: false\r\n示例 3:\r\n输入: pattern = \"aaaa\", s = \"dog cat cat dog\"\r\n输出: false\r\n \r\n提示:\r\n1 <= pattern.length <= 300\r\npattern 只包含小写英文字母\r\n1 <= s.length <= 3000\r\ns 只包含小写英文字母和 \' \'\r\ns 不包含 任何前导或尾随对空格\r\ns 中每个单词都被 单个空格 分隔','class Solution {\r\npublic:\r\n    bool wordPattern(string pattern, string str) {\r\n        unordered_map<string, char> str2ch;\r\n        unordered_map<char, string> ch2str;\r\n        int m = str.length();\r\n        int i = 0;\r\n        for (auto ch : pattern) {\r\n            if (i >= m) {\r\n                return false;\r\n            }\r\n            int j = i;\r\n            while (j < m && str[j] != \' \') j++;\r\n            const string &tmp = str.substr(i, j - i);\r\n            if (str2ch.count(tmp) && str2ch[tmp] != ch) {\r\n                return false;\r\n            }\r\n            if (ch2str.count(ch) && ch2str[ch] != tmp) {\r\n                return false;\r\n            }\r\n            str2ch[tmp] = ch;\r\n            ch2str[ch] = tmp;\r\n            i = j + 1;\r\n        }\r\n        return i >= m;\r\n    }\r\n};',84,'SF','2'),(96,'两数之和\r\n\r\n给定一个整数数组 nums 和一个整数目标值 target，请你在该数组中找出 和为目标值 target  的那 两个 整数，并返回它们的数组下标。\r\n你可以假设每种输入只会对应一个答案。但是，数组中同一个元素在答案里不能重复出现。\r\n你可以按任意顺序返回答案。\r\n\r\n示例 1：\r\n输入：nums = [2,7,11,15], target = 9\r\n输出：[0,1]\r\n解释：因为 nums[0] + nums[1] == 9 ，返回 [0, 1] 。\r\n示例 2：\r\n输入：nums = [3,2,4], target = 6\r\n输出：[1,2]\r\n示例 3：\r\n输入：nums = [3,3], target = 6\r\n输出：[0,1]\r\n \r\n提示：\r\n2 <= nums.length <= 104\r\n-109 <= nums[i] <= 109\r\n-109 <= target <= 109\r\n只会存在一个有效答案','int* twoSum(int* nums, int numsSize, int target, int* returnSize) {\r\n    for (int i = 0; i < numsSize; ++i) {\r\n        for (int j = i + 1; j < numsSize; ++j) {\r\n            if (nums[i] + nums[j] == target) {\r\n                int* ret = malloc(sizeof(int) * 2);\r\n                ret[0] = i, ret[1] = j;\r\n                *returnSize = 2;\r\n                return ret;\r\n            }\r\n        }\r\n    }\r\n    *returnSize = 0;\r\n    return NULL;\r\n}',92,'SF','2'),(97,'有效的括号\r\n\r\n给定一个只包括 \'(\'，\')\'，\'{\'，\'}\'，\'[\'，\']\' 的字符串 s ，判断字符串是否有效。\r\n有效字符串需满足：\r\n左括号必须用相同类型的右括号闭合。\r\n左括号必须以正确的顺序闭合。\r\n每个右括号都有一个对应的相同类型的左括号。\r\n \r\n示例 1：\r\n输入：s = \"()\"\r\n输出：true\r\n示例 2：\r\n输入：s = \"()[]{}\"\r\n输出：true\r\n示例 3：\r\n输入：s = \"(]\"\r\n输出：false\r\n \r\n提示：\r\n1 <= s.length <= 104\r\ns 仅由括号 \'()[]{}\' 组成','char pairs(char a) {\r\n    if (a == \'}\') return \'{\';\r\n    if (a == \']\') return \'[\';\r\n    if (a == \')\') return \'(\';\r\n    return 0;\r\n}\r\n\r\nbool isValid(char* s) {\r\n    int n = strlen(s);\r\n    if (n % 2 == 1) {\r\n        return false;\r\n    }\r\n    int stk[n + 1], top = 0;\r\n    for (int i = 0; i < n; i++) {\r\n        char ch = pairs(s[i]);\r\n        if (ch) {\r\n            if (top == 0 || stk[top - 1] != ch) {\r\n                return false;\r\n            }\r\n            top--;\r\n        } else {\r\n            stk[top++] = s[i];\r\n        }\r\n    }\r\n    return top == 0;\r\n}',89,'SF','2'),(98,'组合\r\n\r\n给定两个整数 n 和 k，返回范围 [1, n] 中所有可能的 k 个数的组合。\r\n你可以按 任何顺序 返回答案。\r\n\r\n示例 1：\r\n输入：n = 4, k = 2\r\n输出：\r\n[\r\n  [2,4],\r\n  [3,4],\r\n  [2,3],\r\n  [1,2],\r\n  [1,3],\r\n  [1,4],\r\n]\r\n示例 2：\r\n输入：n = 1, k = 1\r\n输出：[[1]]\r\n \r\n提示：\r\n1 <= n <= 20\r\n1 <= k <= n','vector<int> temp;\r\nvoid dfs(int cur, int n) {\r\n    if (cur == n + 1) {\r\n        // 记录答案\r\n        // ...\r\n        return;\r\n    }\r\n    // 考虑选择当前位置\r\n    temp.push_back(cur);\r\n    dfs(cur + 1, n, k);\r\n    temp.pop_back();\r\n    // 考虑不选择当前位置\r\n    dfs(cur + 1, n, k);\r\n}',95,'SF','2'),(99,'环形子数组的最大和\r\n\r\n给定一个长度为 n 的环形整数数组 nums ，返回 nums 的非空 子数组 的最大可能和 。\r\n环形数组 意味着数组的末端将会与开头相连呈环状。形式上， nums[i] 的下一个元素是 nums[(i + 1) % n] ， nums[i] 的前一个元素是 nums[(i - 1 + n) % n] 。\r\n子数组 最多只能包含固定缓冲区 nums 中的每个元素一次。形式上，对于子数组 nums[i], nums[i + 1], ..., nums[j] ，不存在 i <= k1, k2 <= j 其中 k1 % n == k2 % n 。\r\n\r\n示例 1：\r\n输入：nums = [1,-2,3,-2]\r\n输出：3\r\n解释：从子数组 [3] 得到最大和 3\r\n示例 2：\r\n输入：nums = [5,-3,5]\r\n输出：10\r\n解释：从子数组 [5,5] 得到最大和 5 + 5 = 10\r\n示例 3：\r\n输入：nums = [3,-2,2,-3]\r\n输出：3\r\n解释：从子数组 [3] 和 [3,-2,2] 都可以得到最大和 3\r\n \r\n提示：\r\nn == nums.length\r\n1 <= n <= 3 * 104\r\n-3 * 104 <= nums[i] <= 3 * 104​​​​​​​','int maxSubarraySumCircular(int* nums, int numsSize) {\r\n    int n = numsSize;\r\n    int leftMax[n];\r\n    // 对坐标为 0 处的元素单独处理，避免考虑子数组为空的情况\r\n    leftMax[0] = nums[0];\r\n    int leftSum = nums[0];\r\n    int pre = nums[0];\r\n    int res = nums[0];\r\n    for (int i = 1; i < n; i++) {\r\n        pre = fmax(pre + nums[i], nums[i]);\r\n        res = fmax(res, pre);\r\n        leftSum += nums[i];\r\n        leftMax[i] = fmax(leftMax[i - 1], leftSum);\r\n    }\r\n\r\n    // 从右到左枚举后缀，固定后缀，选择最大前缀\r\n    int rightSum = 0;\r\n    for (int i = n - 1; i > 0; i--) {\r\n        rightSum += nums[i];\r\n        res = fmax(res, rightSum + leftMax[i - 1]);\r\n    }\r\n    return res;\r\n}',98,'SF','2'),(100,'三角形最小路径和\r\n\r\n给定一个三角形 triangle ，找出自顶向下的最小路径和。\r\n每一步只能移动到下一行中相邻的结点上。相邻的结点 在这里指的是 下标 与 上一层结点下标 相同或者等于 上一层结点下标 + 1 的两个结点。也就是说，如果正位于当前行的下标 i ，那么下一步可以移动到下一行的下标 i 或 i + 1 。\r\n\r\n示例 1：\r\n输入：triangle = [[2],[3,4],[6,5,7],[4,1,8,3]]\r\n输出：11\r\n解释：如下面简图所示：\r\n   2\r\n  3 4\r\n 6 5 7\r\n4 1 8 3\r\n自顶向下的最小路径和为 11（即，2 + 3 + 5 + 1 = 11）。\r\n示例 2：\r\n输入：triangle = [[-10]]\r\n输出：-10\r\n \r\n提示：\r\n1 <= triangle.length <= 200\r\ntriangle[0].length == 1\r\ntriangle[i].length == triangle[i - 1].length + 1\r\n-104 <= triangle[i][j] <= 104','int minimumTotal(int** triangle, int triangleSize, int* triangleColSize) {\r\n    int f[triangleSize][triangleSize];\r\n    memset(f, 0, sizeof(f));\r\n    f[0][0] = triangle[0][0];\r\n    for (int i = 1; i < triangleSize; ++i) {\r\n        f[i][0] = f[i - 1][0] + triangle[i][0];\r\n        for (int j = 1; j < i; ++j) {\r\n            f[i][j] = fmin(f[i - 1][j - 1], f[i - 1][j]) + triangle[i][j];\r\n        }\r\n        f[i][i] = f[i - 1][i - 1] + triangle[i][i];\r\n    }\r\n    int ret = f[triangleSize - 1][0];\r\n    for (int i = 1; i < triangleSize; i++)\r\n        ret = fmin(ret, f[triangleSize - 1][i]);\r\n    return ret;\r\n}',96,'SF','3'),(101,'最长回文子串\r\n\r\n给你一个字符串 s，找到 s 中最长的回文子串。\r\n如果字符串的反序与原始字符串相同，则该字符串称为回文字符串。\r\n\r\n示例 1：\r\n输入：s = \"babad\"\r\n输出：\"bab\"\r\n解释：\"aba\" 同样是符合题意的答案。\r\n示例 2：\r\n输入：s = \"cbbd\"\r\n输出：\"bb\"\r\n \r\n提示：\r\n1 <= s.length <= 1000\r\ns 仅由数字和英文字母组成','#include <iostream>\r\n#include <string>\r\n#include <vector>\r\n\r\nusing namespace std;\r\n\r\nclass Solution {\r\npublic:\r\n    string longestPalindrome(string s) {\r\n        int n = s.size();\r\n        if (n < 2) {\r\n            return s;\r\n        }\r\n\r\n        int maxLen = 1;\r\n        int begin = 0;\r\n        // dp[i][j] 表示 s[i..j] 是否是回文串\r\n        vector<vector<int>> dp(n, vector<int>(n));\r\n        // 初始化：所有长度为 1 的子串都是回文串\r\n        for (int i = 0; i < n; i++) {\r\n            dp[i][i] = true;\r\n        }\r\n        // 递推开始\r\n        // 先枚举子串长度\r\n        for (int L = 2; L <= n; L++) {\r\n            // 枚举左边界，左边界的上限设置可以宽松一些\r\n            for (int i = 0; i < n; i++) {\r\n                // 由 L 和 i 可以确定右边界，即 j - i + 1 = L 得\r\n                int j = L + i - 1;\r\n                // 如果右边界越界，就可以退出当前循环\r\n                if (j >= n) {\r\n                    break;\r\n                }\r\n\r\n                if (s[i] != s[j]) {\r\n                    dp[i][j] = false;\r\n                } else {\r\n                    if (j - i < 3) {\r\n                        dp[i][j] = true;\r\n                    } else {\r\n                        dp[i][j] = dp[i + 1][j - 1];\r\n                    }\r\n                }\r\n\r\n                // 只要 dp[i][L] == true 成立，就表示子串 s[i..L] 是回文，此时记录回文长度和起始位置\r\n                if (dp[i][j] && j - i + 1 > maxLen) {\r\n                    maxLen = j - i + 1;\r\n                    begin = i;\r\n                }\r\n            }\r\n        }\r\n        return s.substr(begin, maxLen);\r\n    }\r\n};',95,'SF','3'),(102,'编辑距离\r\n\r\n给你两个单词 word1 和 word2， 请返回将 word1 转换成 word2 所使用的最少操作数  。\r\n你可以对一个单词进行如下三种操作：\r\n插入一个字符\r\n删除一个字符\r\n替换一个字符\r\n \r\n示例 1：\r\n输入：word1 = \"horse\", word2 = \"ros\"\r\n输出：3\r\n解释：\r\nhorse -> rorse (将 \'h\' 替换为 \'r\')\r\nrorse -> rose (删除 \'r\')\r\nrose -> ros (删除 \'e\')\r\n示例 2：\r\n输入：word1 = \"intention\", word2 = \"execution\"\r\n输出：5\r\n解释：\r\nintention -> inention (删除 \'t\')\r\ninention -> enention (将 \'i\' 替换为 \'e\')\r\nenention -> exention (将 \'n\' 替换为 \'x\')\r\nexention -> exection (将 \'n\' 替换为 \'c\')\r\nexection -> execution (插入 \'u\')\r\n \r\n提示：\r\n0 <= word1.length, word2.length <= 500\r\nword1 和 word2 由小写英文字母组成','class Solution {\r\npublic:\r\n    int minDistance(string word1, string word2) {\r\n        int n = word1.length();\r\n        int m = word2.length();\r\n\r\n        // 有一个字符串为空串\r\n        if (n * m == 0) return n + m;\r\n\r\n        // DP 数组\r\n        vector<vector<int>> D(n + 1, vector<int>(m + 1));\r\n\r\n        // 边界状态初始化\r\n        for (int i = 0; i < n + 1; i++) {\r\n            D[i][0] = i;\r\n        }\r\n        for (int j = 0; j < m + 1; j++) {\r\n            D[0][j] = j;\r\n        }\r\n\r\n        // 计算所有 DP 值\r\n        for (int i = 1; i < n + 1; i++) {\r\n            for (int j = 1; j < m + 1; j++) {\r\n                int left = D[i - 1][j] + 1;\r\n                int down = D[i][j - 1] + 1;\r\n                int left_down = D[i - 1][j - 1];\r\n                if (word1[i - 1] != word2[j - 1]) left_down += 1;\r\n                D[i][j] = min(left, min(down, left_down));\r\n\r\n            }\r\n        }\r\n        return D[n][m];\r\n    }\r\n};',97,'SF','3'),(103,'买卖股票的最佳时机 III\r\n\r\n给定一个数组，它的第 i 个元素是一支给定的股票在第 i 天的价格。\r\n设计一个算法来计算你所能获取的最大利润。你最多可以完成 两笔 交易。\r\n注意：你不能同时参与多笔交易（你必须在再次购买前出售掉之前的股票）。\r\n\r\n示例 1:\r\n输入：prices = [3,3,5,0,0,3,1,4]\r\n输出：6\r\n解释：在第 4 天（股票价格 = 0）的时候买入，在第 6 天（股票价格 = 3）的时候卖出，这笔交易所能获得利润 = 3-0 = 3 。\r\n     随后，在第 7 天（股票价格 = 1）的时候买入，在第 8 天 （股票价格 = 4）的时候卖出，这笔交易所能获得利润 = 4-1 = 3 。\r\n示例 2：\r\n输入：prices = [1,2,3,4,5]\r\n输出：4\r\n解释：在第 1 天（股票价格 = 1）的时候买入，在第 5 天 （股票价格 = 5）的时候卖出, 这笔交易所能获得利润 = 5-1 = 4 。   \r\n     注意你不能在第 1 天和第 2 天接连购买股票，之后再将它们卖出。   \r\n     因为这样属于同时参与了多笔交易，你必须在再次购买前出售掉之前的股票。\r\n示例 3：\r\n输入：prices = [7,6,4,3,1] \r\n输出：0 \r\n解释：在这个情况下, 没有交易完成, 所以最大利润为 0。\r\n示例 4：\r\n输入：prices = [1]\r\n输出：0\r\n \r\n提示：\r\n1 <= prices.length <= 105\r\n0 <= prices[i] <= 105','#define max(a, b) ((a) < (b) ? (b) : (a))\r\n\r\nint maxProfit(int* prices, int pricesSize) {\r\n    int buy1 = -prices[0], sell1 = 0;\r\n    int buy2 = -prices[0], sell2 = 0;\r\n    for (int i = 1; i < pricesSize; ++i) {\r\n        buy1 = max(buy1, -prices[i]);\r\n        sell1 = max(sell1, buy1 + prices[i]);\r\n        buy2 = max(buy2, sell1 - prices[i]);\r\n        sell2 = max(sell2, buy2 + prices[i]);\r\n    }\r\n    return sell2;\r\n}',99,'SF','3'),(104,'颜色分类\r\n\r\n给定一个包含红色、白色和蓝色、共 n 个元素的数组 nums ，原地对它们进行排序，使得相同颜色的元素相邻，并按照红色、白色、蓝色顺序排列。\r\n我们使用整数 0、 1 和 2 分别表示红色、白色和蓝色。\r\n必须在不使用库内置的 sort 函数的情况下解决这个问题。\r\n\r\n示例 1：\r\n输入：nums = [2,0,2,1,1,0]\r\n输出：[0,0,1,1,2,2]\r\n示例 2：\r\n输入：nums = [2,0,1]\r\n输出：[0,1,2]\r\n \r\n提示：\r\nn == nums.length\r\n1 <= n <= 300\r\nnums[i] 为 0、1 或 2','void swap(int *a, int *b) {\r\n    int t = *a;\r\n    *a = *b, *b = t;\r\n}\r\n\r\nvoid sortColors(int *nums, int numsSize) {\r\n    int ptr = 0;\r\n    for (int i = 0; i < numsSize; ++i) {\r\n        if (nums[i] == 0) {\r\n            swap(&nums[i], &nums[ptr]);\r\n            ++ptr;\r\n        }\r\n    }\r\n    for (int i = ptr; i < numsSize; ++i) {\r\n        if (nums[i] == 1) {\r\n            swap(&nums[i], &nums[ptr]);\r\n            ++ptr;\r\n        }\r\n    }\r\n}',96,'SF','3'),(105,'只出现一次的数字\r\n\r\n给你一个 非空 整数数组 nums ，除了某个元素只出现一次以外，其余每个元素均出现两次。找出那个只出现了一次的元素。\r\n\r\n你必须设计并实现线性时间复杂度的算法来解决此问题，且该算法只使用常量额外空间。\r\n\r\n \r\n\r\n示例 1 ：\r\n\r\n输入：nums = [2,2,1]\r\n输出：1\r\n示例 2 ：\r\n\r\n输入：nums = [4,1,2,1,2]\r\n输出：4\r\n示例 3 ：\r\n\r\n输入：nums = [1]\r\n输出：1\r\n \r\n\r\n提示：\r\n\r\n1 <= nums.length <= 3 * 104\r\n-3 * 104 <= nums[i] <= 3 * 104\r\n除了某个元素只出现一次以外，其余每个元素均出现两次。','class Solution {\r\npublic:\r\n    int singleNumber(vector<int>& nums) {\r\n        int ret = 0;\r\n        for (auto e: nums) ret ^= e;\r\n        return ret;\r\n    }\r\n};',76,'SF','3'),(106,'购买两块巧克力\r\n\r\n给你一个整数数组 prices ，它表示一个商店里若干巧克力的价格。同时给你一个整数 money ，表示你一开始拥有的钱数。\r\n你必须购买 恰好 两块巧克力，而且剩余的钱数必须是 非负数 。同时你想最小化购买两块巧克力的总花费。\r\n请你返回在购买两块巧克力后，最多能剩下多少钱。如果购买任意两块巧克力都超过了你拥有的钱，请你返回 money 。注意剩余钱数必须是非负数。\r\n\r\n示例 1：\r\n输入：prices = [1,2,2], money = 3\r\n输出：0\r\n解释：分别购买价格为 1 和 2 的巧克力。你剩下 3 - 3 = 0 块钱。所以我们返回 0 。\r\n示例 2：\r\n输入：prices = [3,2,3], money = 3\r\n输出：3\r\n解释：购买任意 2 块巧克力都会超过你拥有的钱数，所以我们返回 3 。\r\n\r\n提示：\r\n2 <= prices.length <= 50\r\n1 <= prices[i] <= 100\r\n1 <= money <= 100','int buyChoco(int* prices, int pricesSize, int money) {\r\n    int fi = INT_MAX, se = INT_MAX;\r\n    for (int i = 0; i < pricesSize; i++) {\r\n        int price = prices[i];\r\n        if (price < fi) {\r\n            se = fi;\r\n            fi = price;\r\n        } else if (price < se) {\r\n            se = price;\r\n        }\r\n    }\r\n    return money < fi + se ? money : money - fi - se;\r\n}',67,'SF','3'),(107,'字符串中的额外字符\r\n\r\n给你一个下标从 0 开始的字符串 s 和一个单词字典 dictionary 。你需要将 s 分割成若干个 互不重叠 的子字符串，每个子字符串都在 dictionary 中出现过。s 中可能会有一些 额外的字符 不在任何子字符串中。\r\n\r\n请你采取最优策略分割 s ，使剩下的字符 最少 。\r\n\r\n示例 1：\r\n\r\n输入：s = \"leetscode\", dictionary = [\"leet\",\"code\",\"leetcode\"]\r\n输出：1\r\n解释：将 s 分成两个子字符串：下标从 0 到 3 的 \"leet\" 和下标从 5 到 8 的 \"code\" 。只有 1 个字符没有使用（下标为 4），所以我们返回 1 。\r\n示例 2：\r\n\r\n输入：s = \"sayhelloworld\", dictionary = [\"hello\",\"world\"]\r\n输出：3\r\n解释：将 s 分成两个子字符串：下标从 3 到 7 的 \"hello\" 和下标从 8 到 12 的 \"world\" 。下标为 0 ，1 和 2 的字符没有使用，所以我们返回 3 。\r\n \r\n\r\n提示：\r\n\r\n1 <= s.length <= 50\r\n1 <= dictionary.length <= 50\r\n1 <= dictionary[i].length <= 50\r\ndictionary[i] 和 s 只包含小写英文字母。\r\ndictionary 中的单词互不相同。','class Solution {\r\npublic:\r\n    int minExtraChar(string s, vector<string> &dictionary) {\r\n        unordered_set<string> set(dictionary.begin(), dictionary.end());\r\n        int n = s.size();\r\n        vector<int> f(n + 1);\r\n        for (int i = 0; i < n; i++) {\r\n            f[i + 1] = f[i] + 1; // 不选\r\n            for (int j = 0; j <= i; j++) { // 枚举选哪个\r\n                if (set.count(s.substr(j, i - j + 1))) {\r\n                    f[i + 1] = min(f[i + 1], f[j]);\r\n                }\r\n            }\r\n        }\r\n        return f[n];\r\n    }\r\n};',70,'SF','3'),(108,'一个小组的最大实力值\r\n\r\n给你一个下标从 0 开始的整数数组 nums ，它表示一个班级中所有学生在一次考试中的成绩。老师想选出一部分同学组成一个 非空 小组，且这个小组的 实力值 最大，如果这个小组里的学生下标为 i0, i1, i2, ... , ik ，那么这个小组的实力值定义为 nums[i0] * nums[i1] * nums[i2] * ... * nums[ik​] 。\r\n\r\n请你返回老师创建的小组能得到的最大实力值为多少。\r\n\r\n示例 1：\r\n\r\n输入：nums = [3,-1,-5,2,5,-9]\r\n输出：1350\r\n解释：一种构成最大实力值小组的方案是选择下标为 [0,2,3,4,5] 的学生。实力值为 3 * (-5) * 2 * 5 * (-9) = 1350 ，这是可以得到的最大实力值。\r\n示例 2：\r\n\r\n输入：nums = [-4,-5,-4]\r\n输出：20\r\n解释：选择下标为 [0, 1] 的学生。得到的实力值为 20 。我们没法得到更大的实力值。\r\n \r\n\r\n提示：\r\n\r\n1 <= nums.length <= 13\r\n-9 <= nums[i] <= 9','class Solution {\r\npublic:\r\n    long long maxStrength(vector<int>& nums) {\r\n        int n = nums.size();\r\n        // 把正数、负数、零分开记录\r\n        vector<int> neg, pos;\r\n        int zero = 0;\r\n        for (int x : nums) {\r\n            if (x > 0) pos.push_back(x);\r\n            else if (x < 0) neg.push_back(x);\r\n            else zero++;\r\n        }\r\n        sort(neg.begin(), neg.end());\r\n\r\n        // 先按“选出所有正数，以及偶数个绝对值最大的负数”的策略来选择\r\n        // cnt 表示这个策略选出了几个数\r\n        long long ans = 1;\r\n        int cnt = 0;\r\n        for (int x : pos) ans *= x, cnt++;\r\n        for (int i = 0; i + 1 < neg.size(); i += 2) ans *= neg[i] * neg[i + 1], cnt += 2;\r\n        // 这个策略至少选了一个数，可以返回答案\r\n        if (cnt > 0) return ans;\r\n        else {\r\n            // 这个策略没选出数，那答案肯定不是正数了，讨论特殊情况\r\n            // 情况 1：答案最大只能是 0 了，所以有 0 选 0\r\n            if (zero > 0) return 0;\r\n            // 情况 2：连 0 都没有，那只能选最大的负数\r\n            else return nums[0];\r\n        }\r\n    }\r\n};',77,'SF','3'),(109,'测试题目1','测试答案1',11,'TK','1'),(110,'测试题目2','测试答案2',38,'TK','2'),(111,'测试题目3','测试答案3',35,'SZ','3'),(112,'测试题目4','测试答案4',20,'TK','2'),(113,'测试题目5','测试答案5',59,'SF','3'),(114,'测试题目6','测试答案6',39,'SF','1'),(115,'测试题目7','测试答案7',35,'SZ','1'),(116,'测试题目8','测试答案8',47,'TK','2'),(117,'测试题目9','测试答案9',61,'SZ','1'),(118,'测试题目10','测试答案10',71,'TK','3'),(119,'测试题目11','测试答案11',34,'PD','1'),(120,'测试题目12','测试答案12',93,'SZ','3'),(121,'测试题目13','测试答案13',13,'SF','1'),(122,'测试题目14','测试答案14',54,'SF','3'),(123,'测试题目15','测试答案15',98,'SF','1'),(124,'测试题目16','测试答案16',80,'PD','3'),(125,'测试题目17','测试答案17',71,'TK','1'),(126,'测试题目18','测试答案18',87,'PD','2'),(127,'测试题目19','测试答案19',65,'PD','3'),(128,'测试题目20','测试答案20',19,'TK','2'),(129,'测试题目21','测试答案21',27,'PD','1'),(130,'测试题目22','测试答案22',39,'SZ','1'),(131,'测试题目23','测试答案23',57,'TK','2'),(132,'测试题目24','测试答案24',61,'SF','2'),(133,'测试题目25','测试答案25',28,'PD','2'),(134,'测试题目26','测试答案26',47,'TK','2'),(135,'测试题目27','测试答案27',43,'TK','1'),(136,'测试题目28','测试答案28',89,'SZ','2'),(137,'测试题目29','测试答案29',33,'TK','3'),(138,'测试题目30','测试答案30',20,'SF','1'),(139,'测试题目31','测试答案31',57,'TK','1'),(140,'测试题目32','测试答案32',57,'PD','3'),(141,'测试题目33','测试答案33',27,'SF','2'),(142,'测试题目34','测试答案34',68,'PD','1'),(143,'测试题目35','测试答案35',56,'PD','3'),(144,'测试题目36','测试答案36',3,'SZ','1'),(145,'测试题目37','测试答案37',71,'PD','1'),(146,'测试题目38','测试答案38',75,'SF','3'),(147,'测试题目39','测试答案39',15,'PD','2'),(148,'测试题目40','测试答案40',76,'TK','1'),(149,'测试题目41','测试答案41',64,'TK','2'),(150,'测试题目42','测试答案42',41,'PD','3'),(151,'测试题目43','测试答案43',95,'SF','1'),(152,'测试题目44','测试答案44',70,'TK','2'),(153,'测试题目45','测试答案45',68,'SF','2'),(154,'测试题目46','测试答案46',90,'PD','3'),(155,'测试题目47','测试答案47',55,'SZ','2'),(156,'测试题目48','测试答案48',13,'SF','3'),(157,'测试题目49','测试答案49',65,'SZ','1'),(158,'测试题目50','测试答案50',20,'SF','2'),(159,'测试题目51','测试答案51',8,'TK','1'),(160,'测试题目52','测试答案52',66,'TK','3'),(161,'测试题目53','测试答案53',40,'TK','2'),(162,'测试题目54','测试答案54',92,'SF','1'),(163,'测试题目55','测试答案55',78,'PD','2'),(1